class Node(object):    def __init__(self, data, next=None, prev=None):        self.data = data        self.next = next        self.prev = prev    # defining getter and setter for data, next and prev    def getData(self):        return self.data    def setData(self, data):        self.data = data    def getNextNode(self):        return self.next    def setNextNode(self, node):        self.next = node    def getPrevNode(self):        return self.prev    def setPrevNode(self, node):        self.prev = node# class Linked Listclass LinkedList(object):    def __init__(self, head=None):        self.head = head        self.size = 0    def getsize(self):        return self.size    def insert(self, data):        node = Node(data, None, self.head)        self.head = node        # incrementing the size of the linked list        self.size += 1        return True    # delete a node from linked list    def remove(self, value):        prev = None        curr = self.head        while curr:            if curr.getData() == value:                if prev:                    prev.setNextNode(curr.getNextNode())                else:                    self.head = curr.getNextNode()                return True            prev = curr            curr = curr.getNextNode()        return False    # find a node in the linked list    def search(self, value):        curr = self.head        while curr:            if curr.getData() == value:                return True            else:                curr = curr.getNextNode()        return False    # print the linked list    def display(self):        curr = self.head        while curr:            print(curr.data, end=' ')            curr = curr.getNextNode()myList = LinkedList()print("Inserting")print(myList.insert(5))print(myList.insert(15))print(myList.insert(25))myList.display()print(myList.getsize())print(myList.search(25))print(myList.remove(25))myList.display()